snippet.textDisplay:
@Matheus Angelo cara, vejo da mesma forma que vc! Se tivéssemos tido responsabilidade no começo da pandemia, nada estaria como está agr...
Lembro que aqui na minha região foram poucos que seguiram as recomendações. Uma vez precisei ir ao medico, e vi que as ruas estavam cheias... muito triste!
Belas palavras, bro! Espero que essa ideia chegue a mais pessoas e estas se conscientizem!! Ainda temos um longo caminho pela frente.

