snippet.textDisplay:
.@MIQUÉINHA O *Bolsonaro* foi acusado de *genocídio* antes do coronavírus;
O combustível já estava em alta *antes* também;
Sempre que *aumenta* o combustível aumenta o alimento;
O desemprego também estava grande antes da pandemia. 
     O defeito não foi apenas a pandemia, foi a má gestão por incompetência. 
Olha Israel com o país quase todo vacinado. 
O Brasil pode fazer 1 *milhão* de vacina/dia , por que a demora? O nome disso é *incompetência* .

